")]\n","plot(ts(marzo),main=\"NOx 03/2004\")\n","points(which(marzo==-200),marzo[which(marzo==-200)],col=\"red\",pch=19)\n","hist(marzo,main=\"Original march histogram\")"]},{"cell_type":"markdown","id":"385a5253","metadata":{"papermill":{"duration":0.020181,"end_time":"2023-11-02T10:14:01.478885","exception":false,"start_time":"2023-11-02T10:14:01.458704","status":"completed"},"tags":[]},"source":[" In this ocassion, we see that our missing values are not forming groups so a non parametrical estimation can be done. \n"," \n"," **COMMENT**: later we could see that if we apply this to other missing data that form groups, this approach is not very useful; the reason is that when using Nadaraya Watson type estimators we use a concept of \"window\"; basically it takes a point of the support and see how many nearer points there are in a vicinity (given by that mentioned window) and then gives an estimation of the value we would like to predict as a type of \"mean\" of the values that are around it; if we have density of points around the ones we would like to estimate this will work; else it would be using \"fake\" estimations to predict resulting in a very unreliable approach.  \n"," \n"," In our work, we used a non parametrical (Nadaraya Watson type) estimator (using CV methods to select the mentioned \"window\" parameter), to produce a correction to this imputation. \n"," \n"," To see how this worked, we chose the march month and we applied our approach."]},{"cell_type":"code","execution_count":6,"id":"93ff2b73","metadata":{"execution":{"iopub.execute_input":"2023-11-02T10:14:01.524918Z","iopub.status.busy":"2023-11-02T10:14:01.523035Z","iopub.status.idle":"2023-11-02T10:14:21.486266Z","shell.execute_reply":"2023-11-02T10:14:21.482894Z"},"papermill":{"duration":19.991149,"end_time":"2023-11-02T10:14:21.490575","exception":false,"start_time":"2023-11-02T10:14:01.499426","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Install