a":{"papermill":{"duration":0.040372,"end_time":"2023-11-02T10:19:15.862237","exception":false,"start_time":"2023-11-02T10:19:15.821865","status":"completed"},"tags":[]},"source":[" Here we can see, that our predictions have become much better. "]},{"cell_type":"markdown","id":"227aa9b6","metadata":{"papermill":{"duration":0.040985,"end_time":"2023-11-02T10:19:15.943044","exception":false,"start_time":"2023-11-02T10:19:15.902059","status":"completed"},"tags":[]},"source":["## 3. Semiparametric model \n"," A correction is applied in order to obtain more precise predictions. "]},{"cell_type":"code","execution_count":17,"id":"4ec9e8be","metadata":{"execution":{"iopub.execute_input":"2023-11-02T10:19:16.02741Z","iopub.status.busy":"2023-11-02T10:19:16.025501Z","iopub.status.idle":"2023-11-02T10:19:16.056343Z","shell.execute_reply":"2023-11-02T10:19:16.054039Z"},"papermill":{"duration":0.076303,"end_time":"2023-11-02T10:19:16.059137","exception":false,"start_time":"2023-11-02T10:19:15.982834","status":"completed"},"tags":[]},"outputs":[],"source":["ex=train[-length(train)]\n","#We evaluate X_{n-1} in the estimation of the recently obtained autoregression function\n","px=numeric(length(ex))\n","for(i in 1:length(px)){\n","  px[i]=nw1$y[which.min(abs(nw1$x-ex[i]))]\n","}"]},{"cell_type":"markdown","id":"1c61d605","metadata":{"papermill":{"duration":0.039371,"end_time":"2023-11-02T10:19:16.139857","exception":false,"start_time":"2023-11-02T10:19:16.100486","status":"completed"},"tags":[]},"source":[" The correction is basically fit an ARIMA model to the residuals obtained by substracting the non parametric model predictions to the data used, it is, fit an ARIMA model to $X_{n+1}-\\hat{m}(X_{n})$ and after that the new prediction is given by $$X_{n+1}=\\hat{m}(X_{n})+e_{n+1}$$, being $e_{n+1}$ the prediction one step ahead from the fitted ARIMA to residuals. "]},{"cell_type":"code","execution_count":18,"id":"367e9321","metadata":{"execution":{"iopub.execute_input":"2023-11-02T10:19:16.224439Z","iopub.status.busy":"2023-11-02T10:19:16.222484Z","iopub.status.idle":"2023-11-02T10:19:16.48627Z","shell.execute_reply":"2023-11-02T10:19:16.481294Z"},"papermill":{"duration":0.312393,"end_time":"2023-11-02T10:19:16.492028","exception":false,"start_time":"2023-11-02T10:19:16.179635","status":"completed"},"tags":[]},"outputs":[],"source":["#Residual serie for the initial time\n","rs=ex-px\n","#plot(ts(rs))\n","\n","ajuste=auto.arima(rs)"]},{"cell_type":"markdown","id":"9742e1ff","metadata":{"papermill":{"duration":0.048374,"end_time":"2023-11-02T10:19:16.622139","exception":false,"start_time":"2023-11-02T10:19:16.573765","status":"completed"},"tags":[]},"source":["Starting values:"]},{"cell_type":"code","execution_count":19,"id":"c9341d44","metadata":{"execution":{"iopub.execute_input":"2023-11-02T10:19:16.706011Z","iopub.status.busy":"2023-11-02T10:19:16.703977Z","iopub.status.idle":"2023-11-02T10:19:16.732929Z","shell.execute_reply":"2023-11-02T10:19:16.730528Z"},"papermill":{"duration":0.074699,"end_time":"2023-11-02T10:19:16.736405","exception":false,"start_time":"2023-11-02T10:19:16.661706","status":"completed"},"tags":[]},"outputs":[],"source":["as=numeric(length(test))\n","spp=numeric(length(test))\n","as[1]=as.numeric(forecast(ajuste,1)$mean)\n","spp[1]=as[1]+npp[1]"]},{"cell_type":"markdown","id":"cb860ce6","metadata":{"papermill":{"duration":0.03934,"end_time":"2023-11-02T10:19:16.814523","exception":false,"start_time":"2023-11-02T10:19:16.775183","status":"completed"},"tags":[]},"source":["As we need several step ahead predictions we have to add points to the train test in order to obtain the residual time series on time $n$ for each one (this is done in the code)."]},{"cell_type":"code","execution_count":20,"id":"6799165b","metadata":{"execution":{"iopub.execute_input":"2023-11-02T10:19:16.897419Z","iopub.status.busy":"2023-11-02T10:19:16.895295Z","iopub.status.idle":"2023-11-02T10:19:42.918068Z","shell.execute_reply":"2023-11-02T10:1